import './App.css';
import Login from './Components/login_form/login';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';


function App() {
  return (
    <Router>
      <Routes>
        <Route path='/' element={<login />}></Route>
        <Route path='/registration' elem></Route>
      </Routes>
    </Router>
  );
}

export default App;
